        col += 0.13*mcos(6.2832*t*  3.1+vec3(0.5,0.6,1.0));
        col += 0.12*mcos(6.2832*t*  5.1+vec3(0.1,0.7,1.1));
        col += 0.11*mcos(6.2832*t*  9.1+vec3(0.1,0.5,1.2));
